import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import { Nav } from "./Nav";
// import Image1 from "./boston.jpg";
import "./Contact.css";
export class ContactUs extends Component{
  constructor(props){
    super(props);
    if(localStorage.getItem('firstname') == null){
      this.isloggedin = false;
    }else{
      this.isloggedin = true;
    }
  }

  render(){
    return(


<div className="contact-us">
<Nav login={this.isloggedin}/>
  <div className="jumbotron" id="jumbotron1">
    {/* <img src={Image1} alt="boston1"/> */}
    <h2 className="contacth2">CONTACT US</h2>
  </div>
  <div class="section-center">
			<div class="container">
				<div class="row">
          <div class="col-md-7 col-md-push-5">
	          <div class="booking-cta">
	  	        <h1>Just say hello!</h1>
		          <p>Feel free to get in touch with us. We are open to creative ideas, projects and new opportunities</p>
              <p>Boston, US<br/>Phone: +1 999999999<br/>Email: email@email.com</p>
      <p><span class="glyphicon glyphicon-map-marker"></span></p>
      <p><span class="glyphicon glyphicon-phone"></span></p>
      <p><span class="glyphicon glyphicon-envelope"></span></p>
    </div>
          </div>

          <div class="col-md-4 col-md-pull-7">
		        <div class="booking-form"><h1>Just say hello!</h1>
			        <form>
				        <div class="form-group">
					        <input class="form-control" type="text" placeholder="Name"/>
				        </div>
                <div class="form-group">
					        <input class="form-control" type="text" placeholder="Email"/>
				        </div>
                <div class="form-group">
				        	<input class="form-control" type="text" placeholder="PhoneNumber"/>
			        	</div>
                <div class="form-group">
					        <input class="form-control" type="text" placeholder="Queries"/>
				        </div>
				        <div class="form-btn">
						      <button class="submit-btn">Submit</button>
				        </div>
			        </form>
		        </div>
	        </div>
        </div>
      </div>
		</div>
	</div>
);
  }
}
export default withRouter(ContactUs);
